import React from "react";
import { FaHome } from "react-icons/fa";

function Footer() {
  return (
    <div>
      <div className="row bg-primary" style={{ height: "50px" }}>
        <div className="col-sm-2"></div>
        <div
          className="col-sm-2 icon-4x
        "
          style={{ width: "20px" }}
        >
          <FaHome />
        </div>
        <div className="col-sm-2"></div>
        <div className="col-sm-2"></div>
      </div>
    </div>
  );
}

export default Footer;
